MGCAddSnippet(1, "Title Page");
MGCAddSnippet(2, "List of Figures");
MGCAddSnippet(3, "List of Tables");
MGCAddSnippet(4, "");
MGCAddSnippet(5, "Calibre DESIGNrev is a layout viewer specifically designed for displaying and manipulating layout data. Layout viewers differ from full-featured layout editors in terms of the performance and sophistication of key tasks. Layout viewers provide sophisticated data loading and reporting features. Full-featured layout editors provide sophisticated layout editing features.");
MGCAddSnippet(6, "Calibre DESIGNrev was designed specifically for streamlining tasks related to viewing and inspecting data. It also contains sufficient editing capability for targeted fixes and finalizations on your way to tape-out. Calibre DESIGNrev also provides a powerful scripting capability with Tcl, which gives you full custom automated chip-finishing capabilities and allows you to generate text and spreadsheet-based reports about your designs.");
MGCAddSnippet(7, "Calibre DESIGNrev and the other Calibre layout viewers are designed to be used in conjunction with Calibre Interactive and Calibre RVE, when running checks and reviewing check results from most of the Calibre batch tools. Calibre Interactive is a front-end GUI for running Calibre tools in an interactive verification environment. Calibre RVE is a graphical debug program that interfaces with most IC layout tools.");
MGCAddSnippet(8, "There are some licensing and environment variable requirements for running Calibre DESIGNrev.");
MGCAddSnippet(9, "You can run Calibre DESIGNrev in standard mode or in High Capacity (HC) mode. Both modes support options for running Calibre DESIGNrev interactively or non‑interactively.");
MGCAddSnippet(10, "The command descriptions use font properties and several metacharacters to document the command syntax.");
MGCAddSnippet(11, "Basic concepts about Calibre DESIGNrev include topics such as where user preferences and default settings are stored, file types that can be used in Calibre DESIGNrev, and different invocation modes.");
MGCAddSnippet(12, "Calibre DESIGNrev user preferences and default settings are stored in the $HOME/.calibrewb_workspace configuration directory by default. You can use the MGC_CWB_CONFIG_DIRS environment variable to store your preferences in a different location. If your user preference files are removed, you lose your personal settings. The actual files and directories contained in the configuration directory depend on the layout viewer tool you are using.");
MGCAddSnippet(13, "Calibre DESIGNrev can read several different file types and can open compressed layout files directly. Calibre DESIGNrev can only write OASISOASIS is a registered trademark of Thomas Grebinski and licensed for use to SEMI, San Jose. Semi is a registered trademark of Semiconductor Equipment and Materials International., GDSII, and ASCII RDB formats.");
MGCAddSnippet(14, "Depending on how you want to use Calibre DESIGNrev, there are different options for invoking the tool. You can use the ‑h command line argument to display the command line syntax and the ‑version argument to display version information.");
MGCAddSnippet(15, "Invokes Calibre DESIGNrev in interactive GUI mode.");
MGCAddSnippet(16, "Invokes Calibre DESIGNrev in interactive shell mode.");
MGCAddSnippet(17, "Invokes Calibre DESIGNrev in a batch processing, non-interactive mode.");
MGCAddSnippet(18, "Invokes Calibre DESIGNrev in a batch processing GUI mode. Batch GUI mode refers to batch processing in which both the Tcl and Tk packages are available to you.");
MGCAddSnippet(19, "Invokes Calibre DESIGNrev in a non-interactive command mode.");
MGCAddSnippet(20, "You can use the Calibre DESIGNrev GUI to display and edit GDSII layouts, launch other Calibre tools, display results on a layout, and make simple layout changes.");
MGCAddSnippet(21, "Running Calibre DESIGNrev in interactive GUI mode provides you with an interface for viewing and manipulating your layout files.");
MGCAddSnippet(22, "Navigating a large design layout can present challenges due to a limited viewing space. Calibre DESIGNrev provides several different methods, such as zooming and panning capabilities, Cells Browser, and Bookmarks, for adjusting your view to the appropriate locations in your layout.");
MGCAddSnippet(23, "You can use the zoom and pan features in Calibre DESIGNrev to visually scan and magnify the layout.");
MGCAddSnippet(24, "The Cells Browser provides a mechanism for navigating the cell hierarchy in a hierarchical design. When you load a hierarchical design into Calibre DESIGNrev, the cell hierarchy is displayed in the Cells Browser. A cell hierarchy is the traversal order of a tree-like structure of the parent and child cells in a design. You can use the Cells Browser to change the view to display different aspects of the design hierarchy. This includes selecting which cell to display and the view depth to display it with.");
MGCAddSnippet(25, "The Layers Browser includes a Layers Palette for controlling layer visibility and a Colors and Fill Palette for controlling the appearance of layers in a layout.");
MGCAddSnippet(26, "Bookmarks are a method of saving your current view of a layout, allowing you to return to the same view in a layout at any time. Bookmarks store the load options and layout properties that are in effect when the bookmark is created.");
MGCAddSnippet(27, "You can use Calibre DESIGNrev in conjunction with tools, such as Calibre Interactive, Calibre RVE, and Calibre RealTime, to perform a range of tasks within the design verification flow.");
MGCAddSnippet(28, "Calibre DESIGNrev is highly customizable, allowing you to configure your keyboard, rulers, display, and the appearance of data. You can write macros to add or extend functionality to the layout viewer. ");
MGCAddSnippet(29, "The layout viewers provide the ability to define your own keyboard shortcuts and customize your rulers.");
MGCAddSnippet(30, "The layout viewers allow you to define your own keyboard shortcuts for a wide range of functions. These range from clearing rulers and accessing menu items to hiding layers or displaying dialog boxes.");
MGCAddSnippet(31, "You can set the default ruler properties, such as color, direction, and format, using the Rulers tab in the Preferences dialog box. You can also enable or disable the option to allow multiple rulers. ");
MGCAddSnippet(32, "With Calibre DESIGNrev you can modify the visual aspect of the layout viewer.");
MGCAddSnippet(33, "You can change the background color of the Layout Viewing Area, Layers Browser, and Layout Navigator.");
MGCAddSnippet(34, "You can display the user grid to get a quick estimate of sizes and distances. When the grid is visible, it provides cues for calculating space, width, and alignment. The user grid aligns any modifications you make to the design by snapping new vertices to grid points. Mouse input snaps to the user grid, so the grid size also defines the minimum size of the rectangles you can select while selecting an area. Snapping occurs whether the grid is visible or not. The grid is typically not displayed if it becomes so dense it covers the layout so completely as to be unusable.");
MGCAddSnippet(35, "When you open a layout, certain default preferences control drawing of objects, object colors, and panning. You can use the View tab in the Preferences dialog box to set your preferences for displaying the layout.");
MGCAddSnippet(36, "You can configure the appearance of your design data.");
MGCAddSnippet(37, "You can use the GUI to assign custom colors and fill patterns to the layers in your layout in order to make it easier to view. By default, layers display in the layout viewer in ascending numeric layer order which you can also change through the GUI. You can then save these customizations to a layer properties file for future use with the layout.");
MGCAddSnippet(38, "You can use the SVRF rule file that you use with your layout database to load layer names in Calibre DESIGNrev.");
MGCAddSnippet(39, "You can customize the layout viewer with your own fill patterns.");
MGCAddSnippet(40, "You can add new functionality to the layout viewer by writing application extensions called macros. You create macros using Tcl and the layout viewer batch commands.");
MGCAddSnippet(41, "Calibre DESIGNrev provides several options for creating and manipulating objects in a layout.");
MGCAddSnippet(42, "The Layout Viewer Toolbar includes buttons for creating boxes, polygons, paths, and notches.");
MGCAddSnippet(43, "A box is a 4-sided polygon with equal sides. You can render a box in your layout using the Box button in the Layout Viewer Toolbar.");
MGCAddSnippet(44, "A polygon is a closed geometric object defined by three or more non-colinear vertices. The line segment between two adjacent vertices is called a polygon edge. The layout viewer lets you display polygons and their properties. Polygons can be added using the Box (to create a simple box) or the Poly toolbar buttons.");
MGCAddSnippet(45, "A path is a line with thickness, also referred to as a trace. The line segment between two adjacent vertices is called a path centerline. Paths do not have edges. They have a centerline and a width. The layout viewer displays paths and their properties. Calibre batch tools convert them to polygons for processing. Paths have five properties: type, layer, width, location, and shape. These can be modified from the ObjectProperties dialog box. Paths can be interconnected to form a net and can be converted to polygons.");
MGCAddSnippet(46, "A vertex is a point in an edge that breaks the edge into a smaller segments known as fragments. A fragment, which may also be referred to as an edge fragment, can be an entire edge (if the two vertices are both corners) or a part of an edge (if at least one vertex is not). Using the Vertex button on the layout viewer toolbar, additional vertices can be introduced to an edge, breaking that edge into smaller fragments. ");
MGCAddSnippet(47, "A notch is a small rectangular indent of a polygon or box. You can use the Notch button in the Layout Viewer Toolbar to create additional segments in your polygons.");
MGCAddSnippet(48, "You can use the Split button in the Layout Viewer Toolbar to slice paths and polygons into two abutting paths and polygons. ");
MGCAddSnippet(49, "There are multiple methods for selecting and unselecting objects in a layout. You use the Object Selection toolbar to control which objects you can select in the layout. ");
MGCAddSnippet(50, "There are multiple ways of selecting objects in Calibre DESIGNrev. When you click the Select button in the Layout Viewer toolbar, you can select objects from any visible layer, regardless of whether or not the layer is selected in the Layers palette. The Status Toolbar contains a  Selected  field which displays the number of currently selected objects.");
MGCAddSnippet(51, "There are multiple ways you can unselect objects in Calibre DESIGNrev. The status bar shows how many objects are currently selected.");
MGCAddSnippet(52, "Calibre DESIGNrev provides multiple options for moving objects and edges.");
MGCAddSnippet(53, "You can set a directional restriction preference that is used when moving objects. Directional restriction options include arbitrary, manhattan, and 45‑degree.");
MGCAddSnippet(54, "You can select and move one or more path, polygon, reference, and text object types.");
MGCAddSnippet(55, "You can move one or more edges of a polygon or a path.");
MGCAddSnippet(56, "Calibre DESIGNrev provides options for copying layers and objects to different layers.");
MGCAddSnippet(57, "You can select and copy existing objects to a new layer.");
MGCAddSnippet(58, "You can select and copy existing objects to a new layer.");
MGCAddSnippet(59, "You can copy objects on an existing layer to a new layer.");
MGCAddSnippet(60, "The process for deleting objects is basically the same regardless of the type of object you are deleting. However, the process for deleting cells differs from deleting objects.");
MGCAddSnippet(61, "There are multiple methods for deleting objects in a layout.");
MGCAddSnippet(62, "You can use the EditDelete Cell menu item or the Delete menu item in the Cells Browser popup menu to delete a cell.");
MGCAddSnippet(63, "You can merge paths and polygons that are on the same layer and in the same cell.");
MGCAddSnippet(64, "The properties you can view and edit vary between the type (cell, path, polygon, text) of object. However, the process for viewing and modifying properties is basically the same using the Object Properties dialog box. ");
MGCAddSnippet(65, "You use the Object Properties dialog box to view the properties of the selected object. The Object Properties dialog box contains tabs that correspond to the different types of objects in your layout.");
MGCAddSnippet(66, "You use the Object Properties dialog box to edit the properties of the selected object. The tabs in the Object Properties dialog box correspond to the different types of objects in your layout.");
MGCAddSnippet(67, "Calibre DESIGNrev includes several options, such as rulers, layer maps, and overlays, for configuring how you view your design data. ");
MGCAddSnippet(68, "The Calibre DESIGNrev layout viewer lets you inspect a layout in many different ways. ");
MGCAddSnippet(69, "The easiest way to check feature dimensions in your layout is to measure them with rulers, which you manually draw directly onto your design or you can automatically generate rulers for a selected a path or polygon object. These rulers are not saved with the design. You can export rulers or take a snapshot of the rulers.");
MGCAddSnippet(70, "To get comprehensive information about an object in your layout, select it and view its properties. The properties displayed vary according to the type of object you have selected. The object data aids you in targeting areas for fixes.");
MGCAddSnippet(71, "When you want to look at two designs simultaneously, you can load them into separate windows. When you open two or more layouts in their respective windows within one Calibre DESIGNrev session, you can synchronize the panning and zooming operations.");
MGCAddSnippet(72, "For complex designs, the main window may fill with so much information that interpreting what you are seeing can be difficult. Calibre DESIGNrev provides options, such as changing the view depth or hiding layers, to assist in effectively viewing layouts in the main window.");
MGCAddSnippet(73, "You can change the view depth to see the cells you want to work with and to orient yourself in the layout. ");
MGCAddSnippet(74, "Calibre DESIGNrev provides options for hiding or showing all layers, hiding a single layer, or hiding multiple layers in order to better view the layout.");
MGCAddSnippet(75, "To display layer data, the layout viewer draws geometries one layer at a time. When one geometry overlaps another on a different layer, the default mode is to overwrite the colors. You can change the default mode to blend the colors of the overlapping layers.");
MGCAddSnippet(76, "To make layers more distinguishable from each other, consider changing the fill patterns to stripes or cross-hatches. Any sparse fill pattern could help the visibility of multiple layers in your layouts. Contrasting light colors with a dark background also helps in detecting small features embedded in your layouts.");
MGCAddSnippet(77, "You can choose to show or hide groups of layers using layer filters. This can be helpful if you want to switch back and forth viewing groups of layers, depending on your current task. Any layer filters you create are saved to the layer properties file.");
MGCAddSnippet(78, "To hide unnecessary cells from the viewing window, use the Show/Hide References dialog box. Cells can also be hidden by right-clicking on a cell in the Cells Browser.");
MGCAddSnippet(79, "Calibre DESIGNrev provides the ability to preserve GDS text attributes. While working in a layout, you can create and modify text objects and properties. You can also create and modify character shapes.");
MGCAddSnippet(80, "Text Attributes refer to information stored in a design file affecting the display of text. For example, GDS Text Attributes apply to the following characteristics: Text height, alignment, and rotation.");
MGCAddSnippet(81, "Text objects are non-geometrical characters containing alphanumeric text strings. Text objects are often used to label nets and ports for LVS comparisons and certain DRC checks. Text properties describe how the text objects appear. ");
MGCAddSnippet(82, "Text in areas of dense features and multiple layers can hinder you from selecting the correct shape. ");
MGCAddSnippet(83, "Character shapes are polygons in the shape of alphanumeric characters to be represented in the layout. Parentheses are also supported. These shapes are polygon data you save with the design and are printed on the final mask. These are often confused with Text Objects.");
MGCAddSnippet(84, "A layer map file is an ASCII text file that specifies how data on a database layer is represented in the layout viewer when a layout database file is opened. This file also specifies where layer-based data from a loaded layout is placed when exported from the layout viewer to another layout file or format.");
MGCAddSnippet(85, "Layer mapping refers to the process of specifying how data on a database layer gets represented in the layout viewer. A datatype is a record in a GDS or OASIS layout that uniquely identifies the layer an object is on. For example, an object can be on layer 1 datatype 0, and another object can be on layer 1 datatype 1. These can be treated as separate layers.");
MGCAddSnippet(86, "You can generate a layer map file from scratch that is suitable for opening the layout.");
MGCAddSnippet(87, "You can generate a layer map file that is suitable for opening with a specific layout file.");
MGCAddSnippet(88, "You can generate a layer map file from a layout file that is already loaded in Calibre DESIGNrev.");
MGCAddSnippet(89, "This procedure describes how to apply a layer map file when opening a layout file.");
MGCAddSnippet(90, "When exporting a layout file in Calibre DESIGNrev, you can choose a layer map file to export with the layout.");
MGCAddSnippet(91, "Overlaying refers to the process of superimposing layouts (without concatenating the data) for the purpose of visual comparison. Calibre DESIGNrev provides the ability to create, edit, and work with overlays. The user interface for overlays is slightly different than that for viewing individual layout files. ");
MGCAddSnippet(92, "You can use the overlay feature to find similarities and differences in your designs. You can select multiple GDS or OASIS layout files to overlay and compare in the layout window. This allows you to compare multiple layout files to an original design. Overlays are view-only so all of the edit features are disabled within the GUI. However, you can select objects in any of the layouts, take ruler measurements, and use all basic layout viewing capabilities. In addition to using overlays to visually compare layouts, you can save overlays to GDSII and OASIS formats, allowing you to visualize a chip before the final merge.");
MGCAddSnippet(93, "You can create an overlay setup file using a Calibre DESIGNrev command line option or using the Calibre DESIGNrev GUI.");
MGCAddSnippet(94, "Once you load and display an overlay, you can use the Edit Overlay dialog box to modify an overlay.");
MGCAddSnippet(95, "You can export an overlay to an overlay (.ovly) file or, depending on the files that make up the overlay, a GDS (.gds) or OASIS (.oas) file. If the overlay is made up of GDS layout files, you can export to a GDS file. Similarly, if the overlay is made up of OASIS layout files, you can export to an OASIS file. In order to export an overlay, the overlay must be made up of more than one layout file. The export operation exports only the last saved changes. If you make edits to a layout that is part of an overlay, you must save the edits prior to exporting in order for the latest edits to be exported.");
MGCAddSnippet(96, "Saving an overlay file saves the configuration and allows you to reopen it without repeating the setup steps. To close an overlay and all its input layouts, you must first close the overlay and then close each layout. You cannot close an individual layout currently in use by an overlay.");
MGCAddSnippet(97, "Incremental loading helps reduce loading time when reviewing Calibre results with large layout files and mostly flat designs, such as output from OPC and MDP tools. Instead of loading the entire file into memory, incremental loading loads only specified areas into memory, reducing loading and drawing time and memory usage in the layout viewer. Incremental loading enables the layout viewer to load huge layout files into memory that were not possible previously, due to the size limit of the workstation memory. The incremental loading feature supports both GDS and OASIS files.");
MGCAddSnippet(98, "Peeking refers to probing for layout information without loading a layout into memory. Peek objects are created with the layout peek command that displays units, precision, list of cells, list of topcells, list of layers, and other information a layout file.");
MGCAddSnippet(99, "The incremental loading feature uses a cache to index a layout file and uses this index to speed up initial loading of the layout. Incremental load index files are also referred to as PCR (Peek Cache Repository) files. By default, incremental load index files are placed in the directory containing the layout file. However, you can use the MGC_CWB_PCR_PATH environment variable to specify the path to a directory for storing the incremental load index files. ");
MGCAddSnippet(100, "The Calibre DESIGNrev  layout create  batch command and  -incr  switch directs the Tcl command to use an incremental load cache file. You can use this switch to create a cache file from the command line.");
MGCAddSnippet(101, "The Calibre DESIGNrev application has an  -incr  switch directing the tool to invoke the layout viewer in incremental mode, which uses a cache file to aid the initial drawing speed. Invoking the layout viewer with this switch instructs the tool to load the layout incrementally and to generate or update a cache file if needed. When a layout is incrementally loaded, only hierarchical structures are loaded.");
MGCAddSnippet(102, "You can invoke Calibre RVE from within Calibre DESIGNrev and drive incremental loading by loading results from an RDB file. This is useful when you need to review verification results on large layouts.");
MGCAddSnippet(103, "Calibre DESIGNrev can load selected areas, referred to as clips, in the layout viewer s interactive GUI mode. Clips are areas in a layout you mark and can save to a file, so that you can easily access and view them later. Clips are independent of the layout. They can be used as setup for incremental loading and for sharing selected areas with other users.");
MGCAddSnippet(104, "You can create a cache file and subsequently use the cache file to enable faster loading of a layout.");
MGCAddSnippet(105, "You can create a cache file for any layout file and subsequently use the cache file to enable faster loading of a layout.");
MGCAddSnippet(106, "You can use an existing cache (.clv) file to enable faster loading of a layout. When loading a layout in Calibre DESIGNrev, the tool automatically loads a cache file when the layout filename with a .clv suffix is found and the cache file was written with a compatible version. You can set the CWB_CACHE_PATH environment variable to search for cache files when loading a layout.");
MGCAddSnippet(107, "A net is an electronically interconnected set of objects in an electronic design. The layout viewer allows you to highlight a net based on a property name. You can also highlight a set of paths and polygons as a connected net. It extracts the connectivity based on the intersection of polygons and paths on layers in the layout.");
MGCAddSnippet(108, "You can use this procedure to highlight a set of paths and polygons as a connected net. The layout viewer extracts the connectivity based on the intersection of polygons and paths on layers. Each extracted net is represented as a set of polygons on a unique layer. To remove the extracted net, delete the generated net layer. If you reload a layout, all extracted nets are deleted.");
MGCAddSnippet(109, "You can use Calibre DESIGNrev to extract nets by selecting only objects with a specific property.");
MGCAddSnippet(110, "Shortest-path extraction can be used to detect LVS shorts. You can highlight two points from a net and two points originally belonging to another net. By detecting intersecting points, identifying shorts is simplified.");
MGCAddSnippet(111, "You can export an extracted net to RDB, GDS, or OASIS format.");
MGCAddSnippet(112, "Calibre DESIGNrev is part of a larger workflow cycle that takes advantage of the tool s viewing, cross-probing, and editing abilities.");
MGCAddSnippet(113, "When you invoke Calibre Interactive directly from within Calibre DESIGNrev, you can run DRC, LVS, or yield analysis on a cell or area in an open layout database. After processing, you can view the results using Calibre RVE, comparing the information returned from DRC or LVS with data in the layout viewer. ");
MGCAddSnippet(114, "When used in conjunction with Calibre DESIGNrev, Calibre RVE makes it possible for you to visually inspect the results databases output by DRC, LVS, or yield analysis. ");
MGCAddSnippet(115, "Use the procedure to load the results from Calibre verification runs when they are saved as an ASCII results database. This is done automatically if you ran Calibre from Calibre Interactive and selected Show results in RVE.");
MGCAddSnippet(116, "This procedure tells you how to scan a layout using Calibre RVE. It allows you to step through geometries in the layout. Use this procedure to inspect design data. When scanning overlays, only one of the overlay s layout files can be scanned. ");
MGCAddSnippet(117, "Once check results are loaded into Calibre RVE, you can highlight their locations on the layout in Calibre DESIGNrev simply by selecting them in Calibre RVE and issuing the Highlight command.");
MGCAddSnippet(118, "You can save the shapes in the loaded layout as an ASCII format Calibre nmDRC results database. This can be helpful if you want to use the viewing and analysis features of Calibre RVE for DRC. For example, in Calibre RVE for LVS, you can highlight nets in Calibre DESIGNrev then save the highlighted layer as an RDB. ");
MGCAddSnippet(119, "In some cases, DRC violations occur at the toplevel of a design due to interblock interactions that must be fixed at the block level. ");
MGCAddSnippet(120, "When you identify specific layout areas requiring additional processing, you can create a non-design layer (one that is not printed on the final mask) containing markers to be passed to other tools to perform the appropriate operations on those regions. This type of layer is referred to as a marker layer.");
MGCAddSnippet(121, "In situations where you want to mark areas on the top-level cell to control the processing for those regions, you can create a layer and render boxes or polygons as a marker layer.");
MGCAddSnippet(122, "When you need to pass in marker layers identifying key regions in reference cells, a simpler process is to use this method to create areas in duplicate cells.");
MGCAddSnippet(123, "Layout information must often be shared among users, requiring some common point of reference or specific data set that all can work from. In such circumstances, there are multiple methods you can use in the layout viewer to collect layout information to be shared.");
MGCAddSnippet(124, "One method of sharing information is simply passing your view settings for that layout. When passing coordinates, provide additional information such as layer number, view depth, and possibly a layout name and cell name. ");
MGCAddSnippet(125, "You can use clips to mark and save coordinates for areas of interest in a layout. The extracted areas are saved as a GDS layout. These areas are useful in that they can be passed to others to focus work on particular area or object.");
MGCAddSnippet(126, "Once you have established your view settings, you can take a screenshot of the current view and export it to a viewable graphics file for future review.");
MGCAddSnippet(127, "Most of the layout viewer s ability to flatten a hierarchical design file is handled using batch commands.");
MGCAddSnippet(128, "While you normally use the batch commands to flatten a hierarchical layout, support for flattening a cell in the top level hierarchy is available from the layout viewer. You can flatten a cell reference to include the cell contents directly into the design. This places the cell geometry at the top level of the hierarchy and allows you to edit the geometry without affecting the original cell.");
MGCAddSnippet(129, "While you normally use the batch commands to flatten all levels of a cell hierarchy, support is available from the layout viewer. You flatten a hierarchy to include the cell contents directly into the design, allowing you to edit the geometry without affecting the original cell.");
MGCAddSnippet(130, "With Calibre DESIGNrev you can create and edit cells and cell references. ");
MGCAddSnippet(131, "The current cell refers to the cell currently selected and displayed in the viewing window. The layout viewer application window can have only one current cell at any time. By default, the top level cell of the layout is the current cell. You can quickly select a new current cell by clicking on its name in the Cells Browser.");
MGCAddSnippet(132, "A cell is a named object in the layout database that can be referenced within other cells to create hierarchy. Cells can contain geometric text, polygons, paths, cell references, and cell reference arrays. Once you create a cell and populate it with geometries or reference cells, you can reference the new cell from within other cells.");
MGCAddSnippet(133, "A cell reference is a pointer to an original cell. Editing the cell causes the contents of all references to that cell to be updated automatically. The layout viewer revision tool lets you display cell references and their properties. Hierarchical designs are comprised of cells which can be nested. Because a cell reference is a pointer to a single cell, the only property you can edit for it is its placement (location, orientation, and magnification).");
MGCAddSnippet(134, "A cell reference array is a collection of cell references arranged in a two-dimensional array. Cell reference arrays are treated as a single object and manipulated using any function that applies to cell references.");
MGCAddSnippet(135, "When making minor edits using the Calibre layout viewer, you can modify any shape across the layout s cell hierarchy without switching the edit context. This ability to select geometries at any level and edit them directly is useful for making changes to a lower-level polygon with the higher-level context in view. You can either modify the geometry for all instances of the cell in which it is contained, or you can have the tool clone the context and modify the geometry for only the selected cell. ");
MGCAddSnippet(136, "Clones are replicas of cell references. Cells that have more than one instance can have a reference replaced with a reference clone. This is useful if you want to apply edits to an instance but do not want those instances to affect other instances of the same cell.");
MGCAddSnippet(137, "Cloning a cell to create a unique context works even if the context is deep in the cell hierarchy or if array instances are involved. If you choose to clone the cell containing the geometry to be modified, cells up the hierarchy are cloned.");
MGCAddSnippet(138, "You can edit across multiple cell contexts for the delete, move, notch, split, expand, flatten, and split array reference operations. The Editing cells in context setting located on the Objects tab in the Preferences dialog box determines how edits are handled across multiple cell contexts.");
MGCAddSnippet(139, "There are some major GUI items in Calibre DESIGNrev that are also common to the other layout viewers (Calibre WORKbench, Calibre MDPview, and Calibre LITHOview).");
MGCAddSnippet(140, "The Calibre DESIGNrev GUI is a window-based graphical environment consisting of several elements that enable you to view and manipulate your layout.");
MGCAddSnippet(141, "You use the Layout Viewing Area to view and edit the current layout. ");
MGCAddSnippet(142, "The Calibre DESIGNrev layout viewer menus provide access to the application commands.");
MGCAddSnippet(143, "The File menu contains commands used to operate on layout files.");
MGCAddSnippet(144, "Contains commands used to operate on geometric objects selected in the main window.");
MGCAddSnippet(145, "Contains commands used to assist in navigating and viewing the layout, and controlling the display of palettes.");
MGCAddSnippet(146, "Contains commands used to manipulate layers and layer properties.");
MGCAddSnippet(147, "Contains commands for manipulating and creating objects in a design.");
MGCAddSnippet(148, "Contains commands used to perform tool operations on a design.");
MGCAddSnippet(149, "Contains commands used to customize different aspects of the layout viewer.");
MGCAddSnippet(150, "Contains commands used to access Calibre . ");
MGCAddSnippet(151, "Provides access to user-defined macros.");
MGCAddSnippet(152, "Provides access to the user documentation, utilities, and configuration options.");
MGCAddSnippet(153, "The toolbars and palettes are typically groupings of items that are related to a specific operation, such as selecting or finding an object. ");
MGCAddSnippet(154, "Use the layout viewer toolbar to access view controls for navigating a layout and edit mode controls for manipulating the layout.");
MGCAddSnippet(155, "Use the Session toolbar to quickly switch between previously loaded bookmarks, layout files, and overlay files.");
MGCAddSnippet(156, "Use the Find Object Toolbar to find geometries, references, texts, and clips in the layout. Options allow you to control how you navigate to different object types in the layout.");
MGCAddSnippet(157, "Use the Object Selection filters to include or exclude the selection of different object types. You can select one or more object selection filters.");
MGCAddSnippet(158, "Use the layout viewer status bar to find additional information about the current layout. ");
MGCAddSnippet(159, "Use the Clips palette to access and manipulate the clips you create using the Clip tool.");
MGCAddSnippet(160, "Use the Rulers palette to help with layout measurements and manage the rulers in a layout.");
MGCAddSnippet(161, "Calibre DESIGNrev includes browsers for browsing cells, layers, and the layout. ");
MGCAddSnippet(162, "Use the Cells Browser to view and navigate cells in a layout based on a tree or list view.");
MGCAddSnippet(163, "Controls the display and appearance of layers in the layout.");
MGCAddSnippet(164, "The Layers Browser has a context-sensitive popup menu that varies depending on the selection mode and the edit mode.");
MGCAddSnippet(165, "Shows the current viewing area of the layout relative to the whole layout.");
MGCAddSnippet(166, "Some dialog boxes in Calibre DESIGNrev are complex, having multiple tabs or controls that affect other GUI elements.");
MGCAddSnippet(167, "Use the Create Layout dialog box to specify initial values for creating a new layout. The new layout is empty and has the layers you specified.");
MGCAddSnippet(168, "Use the New Overlay dialog box to specify the names of layouts you want to overlay for the purpose of visual comparison.");
MGCAddSnippet(169, "To access: FileOpen Layout Files  Use the Choose Layout Files dialog box to browse to and select a layout to open and for specifying options that control what is loaded with the layout. This dialog box follows the conventions of a standard file and directory navigation tool, but also includes some advanced features specific to the layout viewer.");
MGCAddSnippet(170, "Use the Files tab in the Choose Layout Files dialog box to browse to and select a layout to open. To open multiple files, use Ctrl + click. ");
MGCAddSnippet(171, "Use the Options tab in the Choose Layout Files dialog box to specify the layers to load with the layout and how to handle objects. Settings in this tab persist between layout viewer sessions.");
MGCAddSnippet(172, "Performs an export to a GDSII, OASIS, or RDB file. When exporting to a GDSII or OASIS file, you can specify the objects, regions, and layers to export. When exporting to a flat or hierarchical RDB file, you can specify the objects and layers to export.");
MGCAddSnippet(173, "Use the Open Database dialog box to open Foreign Database Interface (FDI) files. Supported database formats include LEF/DEF and OpenAccess. Calibre DESIGNrev can read LEF/DEF and OpenAccess, but cannot write to these database formats. The tool can only write OASIS and GDSII database formats.");
MGCAddSnippet(174, "Use the Import dialog box to copy all cells directly from one layout into the current layout.");
MGCAddSnippet(175, "Use the Merge Layouts dialog box to merge the contents of two layouts into a third layout. ");
MGCAddSnippet(176, "Use the Layout Filemerge dialog box to perform a disk-based file merge on multiple GDS input files, multiple OASIS input files, or a mix of input formats (GDS and OASIS) without loading the files into memory.");
MGCAddSnippet(177, "Use the Show/Hide References dialog box to select which cell references are displayed in the layout viewer.");
MGCAddSnippet(178, "Use the Snapshot dialog box to create snapshots of the Layout Display Area. ");
MGCAddSnippet(179, "Use the Edit Layers dialog box to modify layers, such as the layer number, layer name, line width, drawing order, and connections between layers.");
MGCAddSnippet(180, "To access: ObjectProperties  Use the Object Properties dialog box to view and adjust the properties associated with objects in the design. ");
MGCAddSnippet(181, "Use the Object Properties Cell tab to view or change cell information.");
MGCAddSnippet(182, "Use the Object Properties Placement tab to change the placement of cells and cell reference arrays.");
MGCAddSnippet(183, "Use the Object Properties Path tab to inspect and adjust selected path properties. ");
MGCAddSnippet(184, "Use the Object Properties Polygon tab to inspect the properties for the currently selected polygon.");
MGCAddSnippet(185, "Use the Object Properties Text tab to inspect and edit the currently selected text object.");
MGCAddSnippet(186, "Use the Object Properties Common tab to inspect and edit the common objects, allowing you to edit properties for multiple selected geometries simultaneously. This tab shows common editable fields across all selected geometries and allows you to change them. An empty field indicates the value differs between selected objects. A layer number and a shift by x and y edit can be applied to the selected geometries.");
MGCAddSnippet(187, "Use the Find Object dialog box to find objects of various types in the current layout.");
MGCAddSnippet(188, "Use the Layout Diff dialog box to highlight places where a reference layout is different from the current layout.");
MGCAddSnippet(189, "To access: OptionsLayout View  Use the Preferences dialog box to customize different aspects of the layout viewer. ");
MGCAddSnippet(190, "Use the View tab in the Preferences dialog box to control the drawing of objects, background and object colors, and panning.");
MGCAddSnippet(191, "Use the Grid tab in the Preferences dialog box to control the behavior and appearance of the grid. ");
MGCAddSnippet(192, "Use the Rulers tab in the Preferences dialog box to control the ruler direction, snapping, and ruler appearance. ");
MGCAddSnippet(193, "Use the Objects tab in the Preferences dialog box to control the default settings for paths and text drawn in the layout viewer window.");
MGCAddSnippet(194, "Use the Nets tab in the Preferences dialog box to control the methods used to detect and highlight net connectivity in the layout viewer. As with rulers, detected nets are temporary and not saved with the design file. ");
MGCAddSnippet(195, "Use the Session tab in the Preferences dialog box to control the appearance of the layout viewer interface and text effects on cell extents. Changes to the session preferences are applied only after you restart the layout viewer.");
MGCAddSnippet(196, "Use the Misc tab in the Preferences dialog box to control options such as the exit behavior, licensing, Layers and Cells palettes, and incremental loading. ");
MGCAddSnippet(197, "Use the RVE/CI Setup dialog box to specify values for Calibre RVE and Calibre Interactive, such as the socket number, highlighting layers, and cell mapping.");
MGCAddSnippet(198, "Use the Bookmarks Editor to add or edit bookmarks.");
MGCAddSnippet(199, "Some troubleshooting tips are provided that address problems frequently encountered when running Calibre DESIGNrev.");
MGCAddSnippet(200, "When you attempt to run Calibre DESIGNrev, the main window never appears, errors appear in the console window, or you cannot see the banner screen.");
MGCAddSnippet(201, "The layout viewer crashes when you invoke it, and the error message returned is similar to  Unrecognized configuration preference. ");
MGCAddSnippet(202, "When you edit your layer properties file, some or all of the changes you make seem to have no effect.");
MGCAddSnippet(203, "You have made one or more changes in the Preferences dialog boxes, but nothing appears to change. ");
MGCAddSnippet(204, "When loading a file, the file loading operation completes, but then the workstation works extremely slowly, including windows unrelated to Calibre DESIGNrev.");
MGCAddSnippet(205, "You have navigated to what you think is the correct directory to open a file, but your file does not appear in the Choose Layout dialog box. ");
MGCAddSnippet(206, "A previously saved file does not appear in the file browser when you try to load it.");
MGCAddSnippet(207, "Clicking on objects in the main display does not select the object.");
MGCAddSnippet(208, "Pasting an object copied to the clipboard to a new location does not copy anything.");
MGCAddSnippet(209, "No objects appear in the design viewing area.");
MGCAddSnippet(210, "For multilayered designs, the object of interest is briefly visible, but then gets buried underneath other objects drawn by the layout viewer.");
MGCAddSnippet(211, "Large sections of the Calibre DESIGNrev window (not limited to the design viewing area) are blank.");
MGCAddSnippet(212, "The grid is on, but grid points are not visible.");
MGCAddSnippet(213, "Clicking on buttons and menus has no effect.");
MGCAddSnippet(214, "A source file known to contain wires erases the wires when the file is loaded into Calibre DESIGNrev.");
MGCAddSnippet(215, "Attempting to type in the console window has no visible effect.");
MGCAddSnippet(216, "Calibre DESIGNrev uses configuration files to store information about the appearance and behavior of the layout viewer. Depending on your environment, you can set up multilevel configuration files for use at a system, project, or user level.");
MGCAddSnippet(217, "To enable levels of the layout viewer configuration, Calibre layout viewers support reading configuration files from directories other than the default layout viewer configuration directory, $HOME/.calibrewb_workspace. For example, a system configuration directory might contain configurations that apply to all users supported by a particular administrator, and a project directory might contain configurations that apply to all usage for a specific project. A single-level configuration meets the needs of many individual users, and most of the users who use the multilevel configuration have it set by an administrator. One feature of a multilevel configuration is that it allows everyone working on a project to share the same configuration.");
MGCAddSnippet(218, "For an individual user configuration, you can manage your preferences, layer properties, bookmarks, layer mappings, keyboard shortcuts, and reader preferences using the layout viewer GUI. Configuration information is automatically saved to and read from $HOME/.calibrewb_workspace. The MGC_CWB_CONFIG_DIRS environment variable is typically not used in this scenario.");
MGCAddSnippet(219, "The administrator manages the system-wide and project-wide preferences, layer properties, bookmarks, keyboard shortcuts, and reader preferences using a text editor and the shell. For system and project usage, the administrator uses the MGC_CWB_CONFIG_DIRS environment variable to specify $HOME/.calibrewb_workspace, a project-wide directory, and a system-wide directory. The user manages preferences, layer properties, bookmarks, layer mappings, keyboard shortcuts, and reader preferences using the layout viewer GUI.");
MGCAddSnippet(220, "A grid enables you to distribute jobs and data among clusters in an established relationship. CAD groups often want a fully managed Calibre DESIGNrev configuration to make sure all users run batch jobs using the same configurations to get the same results, regardless of where the job actually runs in the cluster.");
MGCAddSnippet(221, "When setting up for a partially-managed environment, the administrator specifies a system-wide directory and $HOME/.calibrewb_workspace for MGC_CWB_CONFIG_DIRS in the shell environment.");
MGCAddSnippet(222, "For fully-managed environments, the administrator specifies a system-wide directory for MGC_CWB_CONFIG_DIRS in the shell environment. In the fully-managed environment, $HOME/.calibrewb_workspace is not listed in MGC_CWB_CONFIG_DIRS, and therefore files are not saved in this location.");
MGCAddSnippet(223, "Any time you configure the layout viewer, the tool saves your setting in one of several configuration files. While you can use the GUI to configure some aspects of the tool, you also have the option of editing the configuration files. Some aspects of the layout viewer behavior can only be modified by editing one of the configuration files.");
MGCAddSnippet(224, "The keyprefs file contains the definitions for the key and mouse wheel bindings and is automatically loaded when you invoke a layout viewer.");
MGCAddSnippet(225, "The layerprops file defines the layer properties for a set of design layers, polygon connectivity, and via cell information. The layer properties include the layer number, color, fill, name, visibility, and drawing line width. You can create a layerprops file that defines the default layer properties for all layouts or that defines a layout-specific set of layers.");
MGCAddSnippet(226, "The $HOME/.calibrewb_workspace/preferences file stores default appearance and behavior settings for the layout viewer. The layout viewer reads the preferences file located in the layout viewer configuration directory (it cannot be overridden with a local copy of the file).");
