MGCAddSnippet(417, "The wbinit.tcl file is an application extension file allowing you to write Tcl-based scripts to create customized macros and modifications to the behavior of the layout viewer.");
MGCAddSnippet(418, "The wbposttkinit.tcl file is an application extension file allowing you to write Tcl-based scripts to create customized macros and modifications to the behavior of the layout viewer.");
MGCAddSnippet(419, "RGB colors are represented as hexadecimal values, with a leading pound (#) sign. For example, the hexadecimal number for black is #000000. The first two numbers (00) represent the amount of red in the color. The second two numbers (00) represent the amount of green in the color, and the last two numbers (00) represent the amount of blue the color contains. When a color, such as black, contains 00 amount of red, green or blue, this means it contains none of that color. Colors containing RGB values of FF (255 in decimal) contain the most color. For example, the hexadecimal value for white is #FFFFFF, which means it contains the most red, green, and blue.");
MGCAddSnippet(420, "The layout viewers accept Hex, RGB color values, and color names.");
MGCAddSnippet(421, "A set of default key bindings is provided with the layout viewers. When creating custom key bindings, you should be careful not to overwrite the default key bindings.");
